import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <input type="file" />
        <button onClick={post}>Upload</button>
      </header>
    </div>
  );
}

interface StatusData {
  status: string;
}

function post(): Promise<any> {
  return fetch("http://127.0.0.1:5000", {
    method: "POST",
    // mode: "no-cors", // sending video
    headers: {
      file: "@/Users/alex/sources/hack-a-thing-2-23w-alexander-chen-hack-a-thing-2/server/files/example.mp4",
      // Accept: "multipart/form-data",
      // "Access-Control-Allow-Methods": "GET,POST,OPTIONS,DELETE,PUT",
      // "Access-Control-Allow-Origin": "*",
    },
  })
    .then((response) => {
      console.log(response);
      return response;
    })
    .then((response) => response.json()) // Parse the response in JSON
    .then((response) => {
      console.log(response);
      return response as StatusData; // Cast the response type to our interface
    });
}

export default App;
